import React from "react";
import Bounce from "react-reveal/Bounce";

class NumberCrunch extends React.Component {
  render() {
    return (
      <div>
        <Bounce left>
          <h1>React Reveal</h1>
        </Bounce>
      </div>
    );
  }
}

export default NumberCrunch;
